import "./todo.css";

let style = {
    "font-size": "20px",
};
const Todo = (props) => {
    return (
        <div className="todo">
            <span>{props.name}</span>
            <div className="deleteButton">
                <input className="checkBox" type="checkbox" />

                <button>Delete</button>
            </div>
        </div>
    );
}

export default Todo;
